import React from 'react';

import Facebook from '../../resources/images/icons/path4808.png';

const Contactanos = () => {
    return (
        <div className="contactanos_wrapper">
            <div className="iconos">
                <list>
                    <a href="https://www.facebook.com/Ment-409357773178947">
                    <img src={Facebook} alt="foto" width='40px' href="https://www.facebook.com/Ment-409357773178947"/>
                    </a>
                    <a href="https://www.instagram.com/ment.soluciones"></a>
                </list>
            </div>
        </div>
    );
};

export default Contactanos;
